import { Button } from 'react-bootstrap';

function Menu() {
  return (
    <div style={{ border: '1px solid #f0f0f0', padding: '30px', borderRadius: '6px' }}>
      <div style={{ position: 'sticky', top: '20px' }}>
        <Button>Confirm</Button>
        <Button>Reset</Button>
      </div>
    </div>
  );
}

export default Menu;
